nd characterized by jaundice, fever, liver enlargement, and abdominal pain.','en',1,'2011-05-19 09:36:00',1,'2012-08-10 11:54:12','64c49c40-8940-43f4-9f92-7dcab41ebde7'),(4905,6592,'An opening in the tympanic membrane usually caused by trauma. There are four general categories: compression injuries (the most common and usually the result of a blow to the ear); instrumentation injuries (the second most common, usually inadvertent, caused often by cotton swabs or bobby-pins); burn-slag injuries (frequently seen in industry, from hot metal from machines or welding); and blast injuries (usually seen during war or as a result of terrorist bombing). In the absence of infection, most traumatic tympanic membrane perforations heal spontaneously. Persistent perforation is usually a manifestation of tubotympanitis, an inflammation of the eustachian tube and tympanic cavity (middle ear). (From Paparella, Shumrick, Gluckman, and Meyerhoff: Otolaryngology, vol. II, 3d ed, pp1363-65)','en',1,'2007-10-18 04:28:24',1,'2012-08-10 12:13:40','9271FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4906,6593,'Bitten by a dog.','en',1,'2004-01-01 00:00:00',1,'2012-08-10 11:54:18','ecd885fa-07fe-102c-b5fa-0017a47871b2'),(4907,6594,'Diarrhea and gastroenteritis of presumed infectious origin','en',1,'2012-01-10 22:43:41',1,'2012-08-10 11:54:21','aa6caa8e-f4b4-4629-a231-30777570a077'),(4908,6595,'ulcer in the lining of the stomach or small intestine','en',1,'2004-01-01 00:00:00',1,'2012-08-10 12:07:30','ecd90e26-07fe-102c-b5fa-0017a47871b2'),(4909,6596,'A nutritional condition produced by a deficiency of THIAMINE in the diet, characterized by anorexia, irritability, and weight loss. Later, patients experience weakness, peripheral neuropathy, headache, and tachycardia. In addition to being caused by a poor diet, thiamine deficiency in the United States most commonly occurs as a result of alcoholism, since ethanol interferes with thiamine absorption. In countries relying on polished rice as a dietary staple, BERIBERI prevalence is very high. (From Cecil Textbook of Medicine, 19th ed, p1171)','en',1,'2007-10-18 04:28:24',1,'2012-08-10 12:13:42','7485FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4910,6597,'A condition that can result from any structural or functional cardiac disorder that impairs the ability of the heart to fill with blood or pump a sufficient amount of blood through the body.','en',1,'2008-07-03 14:27:41',1,'2012-08-10 12:07:32','ed266810-07fe-102c-b5fa-0017a47871b2'),(4911,6598,'Infections with nematodes of the superfamily FILARIOIDEA. The presence of living worms in the body is mainly asymptomatic but the death of adult worms leads to granulomatous inflammation and permanent fibrosis. Organisms of the genus Elaeophora infect wild elk and domestic sheep causing ischaemic necrosis of the brain, blindness, and dermatosis of the face.','en',1,'2007-10-18 04:28:24',1,'2012-08-10 12:13:42','5661FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4912,6600,'Infection of the ear canal.','en',1,'2004-01-01 00:00:00',1,'2012-08-10 12:07:38','ecd951b0-07fe-102c-b5fa-0017a47871b2'),(4913,6601,'Infections of the central nervous system caused by TREPONEMA PALLIDUM which present with a variety of clinical syndromes. The initial phase of infection usually causes a mild or asymptomatic meningeal reaction. The meningovascular form may present acutely as BRAIN INFARCTION. The infection may also remain subclinical for several years. Late syndromes include general paresis; TABES DORSALIS; meningeal syphilis; syphilitic OPTIC ATROPHY; and spinal syphilis. General paresis is characterized by progressive DEMENTIA; DYSARTHRIA; TREMOR; MYOCLONUS; SEIZURES; and Argyll-Robertson pupils. (Adams et al., Principles of Neurology, 6th ed, pp722-8)','en',1,'2007-10-18 04:28:24',1,'2012-08-10 12:13:44','4718FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4914,6602,'An acute enteric infection caused by SALMONELLA TYPHI.','en',1,'2007-10-18 04:28:24',1,'2012-08-10 12:13:44','3577FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4915,6603,'Liver infection with hepatitis A virus (\"infectious hepatitis\").','en',1,'2004-01-01 00:00:00',1,'2012-08-10 11:54:39','ecd67ee0-07fe-102c-b5fa-0017a47871b2'),(4916,6604,'painful, single or multiple (1-3), deep and defined or irregular ulcers seen 3-7 d after sexual contact with an infected person; ulcer has a yellow-gray rough base, with soft induration; unilateral or bilateral tender inguinal adenopathy is seen and may suppurate. Constitutional symptoms are rare. Up to 10% of persons with chancroid may be co-infected with syphilis.','en',1,'2007-10-25 05:01:48',1,'2012-08-10 11:54:41','0b393828-15f5-102d-96e4-000c29c2a5d7'),(4917,6605,'A prolonged seizure or seizures repeated frequently enough to prevent recovery between episodes occurring over a period of 20-30 minutes. The most common subtype is generalized tonic-clonic status epilepticus, a potentially fatal condition associated with neuronal injury and respiratory and metabolic dysfunction. Nonconvulsive forms include petit mal status and complex partial status, which may manifest as behavioral disturbances. Simple partial status epilepticus consists of persistent motor, sensory, or autonomic seizures that do not impair cognition (see also EPILEPSIA PARTIALIS CONTINUA). Subclinical status epilepticus generally refers to seizures occurring in an unresponsive or comatose individual in the absence of overt signs of seizure activity. (From N Engl J Med 1998 Apr 2;338(14):970-6; Neurologia 1997 Dec;12 Suppl 6:25-30)','en',1,'2007-10-18 04:28:24',1,'2012-08-10 12:13:44','7738FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4918,6608,'Inflammation of the prostate. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,'2012-08-10 12:13:46','3726FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4919,6609,'A disorder of cardiac function caused by insufficient blood flow to the muscle tissue of the heart. The decreased blood flow may be due to narrowing of the coronary arteries (CORONARY ARTERIOSCLEROSIS), to obstruction by a thrombus (CORONARY THROMBOSIS), or less commonly, to diffuse narrowing of arterioles and other small vessels within the heart. Severe interruption of the blood supply to the myocardial tissue may result in necrosis of cardiac muscle (MYOCARDIAL INFARCTION).','en',1,'2007-10-18 04:28:24',1,'2012-08-10 12:13:46','4802FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4920,6610,'An acute, highly infectious disease caused by a bacillus (Salmonella typhi) transmitted chiefly by contaminated food or water and characterized by high fever, headache, coughing, intestinal hemorrhaging, and rose-colored spots on the skin.','en',1,'2004-01-01 00:00:00',1,'2012-08-10 11:54:51','ecd852b0-07fe-102c-b5fa-0017a47871b2'),(4921,6611,'Une sorte de malnutrition','fr',1,'2007-02-20 23:05:44',1,'2012-08-10 13:42:44','ecedcd2a-07fe-102c-b5fa-0017a47871b2'),(4922,6611,'The lack of sufficient energy or protein to meet the body\'s metabolic demands, as a result of either an inadequate dietary intake of protein, intake of poor quality dietary protein, increased demands due to disease, or increased nutrient losses.','en',1,'2007-02-20 23:05:44',1,'2012-08-10 13:42:44','ecedcb40-07fe-102c-b5fa-0017a47871b2'),(4923,6612,'Implantation and subsequent development of a fertilized ovum outside the uterus, as in a fallopian tube.','en',1,'2004-01-01 00:00:00',1,'2012-08-10 11:54:55','ecd6a262-07fe-102c-b5fa-0017a47871b2'),(4924,6614,'Clinical finding of acneiform lesions (pimples) on the skin.','en',1,'2004-05-04 00:00:00',1,'2012-08-10 15:52:29','ece10b1c-07fe-102c-b5fa-0017a47871b2'),(4925,6615,'Ulcer that occurs in those portions of the alimentary tract which come into contact with gastric juice containing pepsin and acid. It occurs when the amount of acid and pepsin is sufficient to overcome the gastric mucosal barrier.','en',1,'2007-10-18 04:28:24',1,'2012-08-10 12:13:48','5225FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4926,6616,'The virus that causes the acquired immune deficiency syndrome (AIDS).','en',1,'2004-05-27 00:00:00',1,'2012-08-10 11:55:03','ece16f4e-07fe-102c-b5fa-0017a47871b2'),(4927,6617,'Bacterial infection and inflammation of the vermiform appendix.','en',1,'2004-01-01 00:00:00',1,'2012-08-10 11:55:05','ecd8ddfc-07fe-102c-b5fa-0017a47871b2'),(4928,6618,'Superficial bacterial infection of the skin.','en',1,'2004-01-01 00:00:00',1,'2012-08-10 12:07:52','ecd83d16-07fe-102c-b5fa-0017a47871b2'),(4929,6619,'An inflammatory process of the mucous membranes of the paranasal sinuses that occurs in three stages: acute, subacute, and chronic. Sinusitis results from any condition causing ostial obstruction or from pathophysiologic changes in the mucociliary transport mechanism.','en',1,'2007-10-18 04:28:24',1,'2012-08-10 12:13:48','6529FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4930,6620,'An acute form of TUBERCULOSIS in which minute tubercles are formed in a number of organs of the body due to dissemination of the bacilli through the blood stream.','en',1,'2007-10-18 04:28:24',1,'2012-08-10 12:13:49','4458FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4931,6622,'Varicosities of the hemorrhoidal venous plexuses.','en',1,'2011-05-20 17:08:17',1,'2012-08-10 11:55:13','ad5ae9bc-85b9-4de5-9f74-6a7e8c0590a1'),(4932,6623,'Pain in the ear.','en',1,'2007-10-18 04:28:24',1,'2012-08-10 12:13:50','9519FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4933,6624,'Pregnancy continuing beyond the normal duration; in humans, usually beyond 294 days after the beginning of the last menses. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,'2012-08-10 12:13:51','3730FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4934,6625,'Pink eye resulting from a virus.','en',1,'2008-11-18 10:17:26',1,'2012-08-10 11:55:17','39974b4f-a737-4b22-b19f-623a3ea6e76c'),(4935,6626,'Infection with measles virus, with characteristic rash and Koplek spots in mouth.','en',1,'2004-01-01 00:00:00',1,'2012-08-10 11:55:19','ecd75586-07fe-102c-b5fa-0017a47871b2'),(4936,6627,'a contagious respiratory illness caused by influenza viruses','en',1,'2008-11-10 11:22:00',1,'2012-08-10 11:55: