n sorte de malnutrition','fr',1,'2007-02-20 23:04:42',1,'2012-08-10 12:08:09','ecedc924-07fe-102c-b5fa-0017a47871b2'),(4947,6640,'Condition in which liquid from stomach regurgitates into esophagus, damaging or inflaming the lining.','en',1,'2008-11-10 11:11:08',1,'2012-08-10 11:55:48','b86122fc-d6d4-4467-a8a8-82d2057d74ea'),(4948,6641,'A noncancerous enlargement of the thyroid gland, visible as a swelling at the front of the neck, that is often associated with iodine deficiency.','en',1,'2004-01-01 00:00:00',1,'2012-08-10 11:55:50','ecd839c4-07fe-102c-b5fa-0017a47871b2'),(4949,6642,'Enlargement or overgrowth of the prostate gland as a result of an increase in the number of its constituent cells.','en',1,'2007-10-18 04:28:24',1,'2012-08-10 12:13:55','6277FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4950,6643,'Bacterial Pneumonia','en',1,'2012-01-24 22:03:15',1,'2012-08-10 11:55:54','ae80980f-3757-4a95-a52c-c1b8cf3a6d66'),(4951,6644,'An abnormal excess accumulation of serous fluid in connective tissue or in a serous cavity.','en',1,'2004-01-01 00:00:00',1,'2012-08-10 11:55:56','ecdc537e-07fe-102c-b5fa-0017a47871b2'),(4952,6645,'An abnormal accumulation of serous fluid in the abdominal cavity.','en',1,'2004-01-01 00:00:00',1,'2012-08-10 11:55:58','ecddd14a-07fe-102c-b5fa-0017a47871b2'),(4953,6647,'Liver diseases associated with alcoholism. It usually refers to the coexistence of two or more subentities, i.e., alcoholic fatty liver, alcoholic hepatitis, and alcoholic liver cirrhosis, but may be the general entity when subentities are not specified.','en',1,'2007-10-18 04:28:24',1,'2012-08-10 12:13:55','15266FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4954,6648,'An acute bacterial infection caused by ingestion of BACILLUS organisms. Carnivores may become infected from ingestion of infected carcasses. It is transmitted to humans by contact with infected animals or contaminated animal products. The most common form in humans is cutaneous anthrax.','en',1,'2007-10-18 04:28:24',1,'2012-08-10 